        <View style={[styles.box, styles.bgPrimary]}></View>
        <View style={[styles.box, styles.bgPrimary]}></View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  containerCenter: {
    flex: 1,
    flexDirection: 'row',
    justifyContent: 'space-around',

  },
  box: {
    height: 70,
    width: 70,
    margin: 2
  },
  bgPrimary: {
    backgroundColor: '#007bff'
  }
});
